import React from "react"
import Card from "./Card"

function App() {
    return (
        <div>
            <Card cardColor="red" cardHeight={200} cardWidth={55} />
            <Card />
            <Card cardColor="yellow" cardHeight={50} cardWidth={155} />
        </div>
    )
}

export default App
